import React from "react";
import DiagramSVG from "./DiagramSVG";

export const Diagram = ({
  anchorCharts,
  setAnchorCharts,
  multiGlossaries,
  setMultiGlossaries,
  notice,
  setNotice,
  multiParent,
  setMultiParent,
  multiSummaries,
  setMultiSummaries,
  authentic,
  setAuthentic,
  summaries,
  setSummaries,
  textSketch,
  setTextSketch,
}) => {
  return (
    <div className="main-diagram">
      <div className="diagram-container">
        <DiagramSVG />
      </div>
    </div>
  );
};

export default Diagram;
